import React from 'react';
import { Link } from 'react-router-dom';
import './App.css';
import logo from './voxxy-icon.png'; // Ensure the image is in the same folder or provide the correct path

// Home Page Component
function Home() {
  return (
    <div className="section">
      <header>
        <image src={logo} alt="Voxxy Logo" />
        <nav>
          <Link to="/">Home</Link>
          <Link to="/trip-planner">Trip Planner</Link>
          <Link to="/about-us">About Us</Link>
          <Link to="/login">Log In</Link>
          <Link to="/logout">Log Out</Link>
        </nav>
      </header>
      <main>
        <h1>Plan Your Next Adventure with Voxxy!</h1>
        <p>Smart, seamless, and stress-free trip planning designed just for you and your crew.</p>
        <div>
          <button className="button button-primary">Sign up to get started</button>
          <button className="button button-secondary">Log in to continue</button>
        </div>
      </main>
    </div>
  );
}
export default Home;
